import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Timeline() {
  const [characterDetails, setCharacterDetails] = useState(null);

  useEffect(() => {
    axios.get('https://genshinlist.com/api/characters')
      .then(response => {
        const dilucCharacter = response.data.find(character => character.name === 'Diluc');
        if (dilucCharacter) {
          setCharacterDetails(dilucCharacter);
          console.log('Character Details:', dilucCharacter); // Added console log
        } else {
          console.log('Character not found');
        }
      })
      .catch(error => {
        console.log(error);
      });
  }, []);

  const renderTimeline = () => {
    if (!characterDetails) return null;

    const { birthday } = characterDetails;
    const currentYear = new Date().getFullYear();
    const birthYear = new Date(birthday).getFullYear();
    const age = currentYear - birthYear;

    // Assuming the character was born on the same day every year for simplicity
    const timelineItems = [];
    for (let year = birthYear; year <= currentYear; year++) {
      const itemText = `${year}: ${age} years old`;
      timelineItems.push(<div key={year}>{itemText}</div>);
    }

    return (
      <div>
        <h3>Birthday Timeline for {characterDetails.name}</h3>
        <div style={{ marginTop: '10px' }}>
          {timelineItems.map(item => item)}
        </div>
      </div>
    );
  };

  return (
    <div className='page' style={{ backgroundColor: '#192536', color: 'white', padding: '20px', margin: '0'}}>
      {renderTimeline()}
    </div>
  );
}

export default Timeline;
